2. Switch Metamask to use local node (2999 for chainId, http://localhost:9933/ for url) - add network.
3. Create a NFT with eth-wallet, can use the app-hub branch below to create collection, series and set name commenting/uncommenting the tx required (https://github.com/cennznet/app-hub/blob/spike/mintNFTFromEthWallet/pages/_app.tsx#L99)
